(1161,581,'de','2023-09-06 11:21:41.117130','2023-09-06 11:21:57.685052','Lade die Tabellenvorlage herunter, importiere deine Daten, speichere sie als csv-Datei und lade sie hoch. Behalte die Anzahl und Namen der Spalten sowie Feldart bei. Bitte beachte, dass der Dateiname in der Importdatei in Gro-/Kleinschreibung genau dem zu importierenden Dateinamen entsprechen muss. Dies betrifft auch die Dateiendung: .jpg, .JPG, .jpeg etc. sind unterschiedliche Benennungen. Sprachbeschreibungen sollten entweder in Englisch oder im Alpha2- oder Alpha3-Code erfolgen. Delimiter sollten entweder Semikolon oder Tab sein. Komprimiere die csv-Datei zusammen mit den Fotos in eine zip-Datei und lade sie hoch (keine Unterordner in der zip-Datei!).'),
(1162,581,'en','2023-09-06 11:21:41.120593','2023-09-06 11:21:41.120593','Lade die Tabellenvorlage herunter, importiere deine Daten, speichere sie als csv-Datei und lade sie hoch. Behalte die Anzahl und Namen der Spalten sowie Feldart bei. Bitte beachte, dass der Dateiname in der Importdatei in Gro-/Kleinschreibung genau dem zu importierenden Dateinamen entsprechen muss. Dies betrifft auch die Dateiendung: .jpg, .JPG, .jpeg etc. sind unterschiedliche Benennungen. Sprachbeschreibungen sollten entweder in Englisch oder im Alpha2- oder Alpha3-Code erfolgen. Delimiter sollten entweder Semikolon oder Tab sein. Komprimiere die csv-Datei zusammen mit den Fotos in eine zip-Datei und lade sie hoch (keine Unterordner in der zip-Datei!).'),
(1163,582,'de','2023-09-06 11:21:41.124908','2023-09-06 11:21:57.690036','Lade die Tabellenvorlage herunter, importiere deine Daten, speichere als csv-Datei und lade sie hoch. Behalte die Anzahl und Namen der Spalten sowie Feldart bei. Sprachbeschreibungen sollten entweder in Englisch oder im Alpha2- oder Alpha3-Code erfolgen. Delimiter sollten entweder Semikolon oder Tab sein.'),
(1164,582,'en','2023-09-06 11:21:41.128346','2023-09-06 11:21:41.128346','Download this spreadsheet template, fill in your data, save as csv and upload. Keep column number and names as well as field types. Languages should be given in english or in alpha2- or alpha3-codes. Use semicolon or tab as delimiter.'),
(1165,583,'de','2023-09-06 11:21:41.132614','2023-09-06 11:21:57.694830','Lade die Tabellenvorlage herunter, importiere deine Daten, speichere als csv-Datei und lade sie hoch. Behalte die Anzahl und Namen der Spalten sowie Feldart bei. Delimiter sollten entweder Semikolon oder Tab sein.'),
(1166,583,'en','2023-09-06 11:21:41.136057','2023-09-06 11:21:41.136057','Download this spreadsheet template, fill in your data, save as csv and upload. Keep column number and names as well as field types. Use semicolon or tab as delimiter.'),
(1167,584,'de','2023-09-06 11:21:41.140273','2023-09-06 11:21:57.699549','Komprimiere deine Protokoll- oder Biografietextdateien in eine zip-Datei und lade sie hoch (die Textdateien mssen flach in der zip-Datei liegen, also keine Unterordner!). Dateinamen mssen dem Muster Interview-ID_Typ_Sprache.ext folgen, wobei der Typ fr Biographieen \'bg\' und fr Protokolle \'prot\' ist. Z.B. za123_prot_de.rtf oder za007_bg_de.odt.'),
(1168,584,'en','2023-09-06 11:21:41.151973','2023-09-06 11:21:41.151973','Compress your protocoll- or biography-files into a zip file and upload. No subfolders in the zip-archive allowed. File names must be like InterviewID_Type_Language.ext, where type is \'bg\' for biographies and \'prot\' for protocolls. E.g. za123_prot_de.rtf or za007_bg_de.odt.'),
(1169,585,'de','2023-09-06 11:21:41.156277','2023-09-06 11:21:57.703889','Es knnen Transkripte in den Formaten .csv, .ods, .odt, .vtt, .srt hochgeladen werden. Im .csv- und .ods-Format mssen die Spalten mit \'In|Timecode\', \'Speaker|Sprecher\' und \'Trans[c|k]ript|Translation|bersetzung\' betitelt werden. Dateien im .odt-Format sollten nur den Transkripttext (inkl. Sprecher*innenauszeichnungen) ohne Header, Footer oder anderen Text enthalten.'),
(1170,585,'en','2023-09-06 11:21:41.159634','2023-09-06 11:21:41.159634','Es knnen Transkripte in den Formaten .csv, .ods, .odt, .vtt, .srt hochgeladen werden. Im .csv- und .ods-Format mssen die Spalten mit \'In|Timecode\', \'Speaker|Sprecher\' und \'Trans[c|k]ript|Translation|bersetzung\' betitelt werden. Dateien im .odt-Format sollten nur den Transkripttext (inkl. Sprecher*innenauszeichnungen) ohne Header, Footer oder anderen Text enthalten.'),
