(6302,580,'el','2023-09-06 11:22:23.088141','2023-09-06 11:22:23.088141','Whle zuerst was du  importieren mchtest.'),
(6303,581,'el','2023-09-06 11:22:23.092793','2023-09-06 11:22:23.092793','Lade die Tabellenvorlage herunter, importiere deine Daten, speichere sie als csv-Datei und lade sie hoch. Behalte die Anzahl und Namen der Spalten sowie Feldart bei. Bitte beachte, dass der Dateiname in der Importdatei in Gro-/Kleinschreibung genau dem zu importierenden Dateinamen entsprechen muss. Dies betrifft auch die Dateiendung: .jpg, .JPG, .jpeg etc. sind unterschiedliche Benennungen. Sprachbeschreibungen sollten entweder in Englisch oder im Alpha2- oder Alpha3-Code erfolgen. Delimiter sollten entweder Semikolon oder Tab sein. Komprimiere die csv-Datei zusammen mit den Fotos in eine zip-Datei und lade sie hoch (keine Unterordner in der zip-Datei!).'),
(6304,582,'el','2023-09-06 11:22:23.098033','2023-09-06 11:22:23.098033','Lade die Tabellenvorlage herunter, importiere deine Daten, speichere als csv-Datei und lade sie hoch. Behalte die Anzahl und Namen der Spalten sowie Feldart bei. Sprachbeschreibungen sollten entweder in Englisch oder im Alpha2- oder Alpha3-Code erfolgen. Delimiter sollten entweder Semikolon oder Tab sein.'),
(6305,583,'el','2023-09-06 11:22:23.103220','2023-09-06 11:22:23.103220','Lade die Tabellenvorlage herunter, importiere deine Daten, speichere als csv-Datei und lade sie hoch. Behalte die Anzahl und Namen der Spalten sowie Feldart bei. Delimiter sollten entweder Semikolon oder Tab sein.'),
(6306,584,'el','2023-09-06 11:22:23.108341','2023-09-06 11:22:23.108341','Komprimiere deine Protokoll- oder Biografietextdateien in eine zip-Datei und lade sie hoch (die Textdateien mssen flach in der zip-Datei liegen, also keine Unterordner!). Dateinamen mssen dem Muster Interview-ID_Typ_Sprache.ext folgen, wobei der Typ fr Biographieen \'bg\' und fr Protokolle \'prot\' ist. Z.B. za123_prot_de.rtf oder za007_bg_de.odt.'),
(6307,585,'el','2023-09-06 11:22:23.121272','2023-09-06 11:22:23.121272','Es knnen Transkripte in den Formaten .csv, .ods, .odt, .vtt, .srt hochgeladen werden. Im .csv- und .ods-Format mssen die Spalten mit \'In|Timecode\', \'Speaker|Sprecher\' und \'Trans[c|k]ript|Translation|bersetzung\' betitelt werden. Dateien im .odt-Format sollten nur den Transkripttext (inkl. Sprecher*innenauszeichnungen) ohne Header, Footer oder anderen Text enthalten.'),
